import React from "react";
import { BrowserRouter as Router, Routes, Route, useNavigate } from "react-router-dom";
import './tailwind.css';
import Myprovider, { useAuth } from "./context/Myprovider";
import HomePage from "./components/home";
import Signup from "./components/Signup-Login";
import UpdateProfile from "./components/profile";
import SignIn from "./components/login";
import DonersData from "./components/done's";
import Contact from "./components/contact";

function ProtectedRoute({ element, ...rest }) {
  const { isAuthenticated } = useAuth();
  const navigate = useNavigate();

  if (!isAuthenticated) {
    navigate("/login");
    return null;
  }

  return element;
}

function App() {
  return (
    <Myprovider>
      <Router>
        <Routes>
          <Route path="/" element={<SignIn />} />
          <Route path="/home" element={<ProtectedRoute element={<HomePage />} />} />
          <Route path="/login" element={<SignIn />} />
          <Route path="/Signup" element={<Signup />} />
          <Route path="/profile" element={<ProtectedRoute element={<UpdateProfile />} />} />
          <Route path="/doner" element={<ProtectedRoute element={<DonersData />} />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
      </Router>
    </Myprovider>
  );
}

export default App;
